import React, { memo } from 'react';
import { CircularProgress } from '@mui/material';
import { Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow } from '@mui/material';

import { Container } from './styles';

import { TableProps, Data } from './types';

const TableBar = ({ className, header, data, isFetching }: TableProps) => (
  <Container className={className}>
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            {header.map((hd: Data, ind: number) => <TableCell key={`${hd.value}${ind}`} align={hd.align}>{hd.value}</TableCell>)}
          </TableRow>
        </TableHead>
        <TableBody>
          {data.map((row) => (
            <TableRow key={row.id}>
              {row.data.map((r: Data) => (
                <TableCell align={r.align}>{r.value}</TableCell>
              ))}
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    <CircularProgress color="primary" />
  </Container>
);

export default memo(TableBar);
